import React, { useEffect, useState } from "react";



function App(){

    const [name,setname] = useState("Hello");
    const [mouseover,setmouseover]= useState(true);
    function Submit(){
        setname(name);
    }

    function handleover(){
        setmouseover(true)
    }

 return (
    <div>
      <h1>{name}</h1>
    <input type="text" placeholder="What's Your Name" />
    <button style={{backgroundColor: mouseover ? "black" :"white" }} onClick={Submit}
    onMouseOver= {handleover}
    >Submit</button>
     
    </div>
   
 )
}
export default App;
